import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles, withStyles } from '@mui/styles'
import { ThemeProvider, createTheme } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Hidden from '@mui/material/Hidden';
import BurgerMenu from './components/burger-menu';
import HorizontalMenu from './components/horizontal-menu';
import Banner from './components/banner';
import AboutUs from './components/about-us';
import Services from './components/services';
import ContactUs from './components/contact-us';
import AppBar from '@mui/material/AppBar';

const topBannerImg = '945859-5.jpg';
const middleBannerImg = '945859-7.jpg';
const bottomBannerImg = '945859-6.jpg';

const theme = createTheme({
  typography: {
    // Use the system font.
    display4: {
      fontFamily: 'montserrat',
      letterSpacing: '0em',
      marginRight: '1.9em',
      marginLeft: '1.9em',
      fontSize: '4.5em',
      fontWeight: '100',
    },
    display3: {
      fontFamily:'EB garamond',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '2em',
      letterSpacing: '0em',
      lineHeight: '1.2em',
      color: '#00988c'
    },
    display2: {
      fontFamily:'montserrat',
      fontWeight: '400',
      fontStyle: 'normal',
      fontSize: '18px',
      letterSpacing: '.05em',
      lineHeight: '1.3em',
      textTransform: 'uppercase',
      color: '#001726'
    },
    subheading: {
      fontFamily:'montserrat',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '14px',
      letterSpacing: '0.05em',
      lineHeight: '1.em',
      textTransform: 'uppercase',
      color: '#001726',
    },
    title: {
      fontFamily:'montserrat',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '14px',
      letterSpacing: '.1em',
      lineHeight: '1.em',
      textTransform: 'uppercase',
      color: '#001726',
    },
    body1: {
      fontFamily:'montserrat',
      fontWeight: '400',
      wordWrap: 'break-word',
      fontStyle: 'normal',
      fontSize: '.8em',
      letterSpacing: '.015em',
      lineHeight: '1.7em',
      textTransform: 'none',
      color: '#001726',
      paddingBottom: '1em',
    },
    button: {
      fontFamily:'montserrat',
      fontWeight: '600',
      letterSpacing: '.1em',
      fontSize: '12px',
      textTransform: 'lowercase',
      color:'#001726'
    },
    caption: {
      fontFamily: 'oswald',
      fontWeight: '700',
      fontStyle: 'normal',
      fontSize: '12px',
      letterSpacing: '.1em',
      lineHeight: '3em',
      textTransform: 'uppercase',
      color: '#000',
    }
  },
});

const styles = {
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    border: 0,
    borderRadius: 3,
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
    color: 'white',
    height: 48,
    padding: '0 30px',
  },
};

const useStyles = makeStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    border: 0,
    borderRadius: 3,
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
    color: 'white',
    height: 48,
    padding: '0 30px',
  },
  typography: {
    // Use the system font.
    display4: {
      fontFamily: 'montserrat',
      letterSpacing: '0em',
      marginRight: '1.9em',
      marginLeft: '1.9em',
      fontSize: '4.5em',
      fontWeight: '100',
    },
    display3: {
      fontFamily:'EB garamond',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '2em',
      letterSpacing: '0em',
      lineHeight: '1.2em',
      color: '#00988c'
    },
    display2: {
      fontFamily:'montserrat',
      fontWeight: '400',
      fontStyle: 'normal',
      fontSize: '18px',
      letterSpacing: '.05em',
      lineHeight: '1.3em',
      textTransform: 'uppercase',
      color: '#001726'
    },
    subheading: {
      fontFamily:'montserrat',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '14px',
      letterSpacing: '0.05em',
      lineHeight: '1.em',
      textTransform: 'uppercase',
      color: '#001726',
    },
    title: {
      fontFamily:'montserrat',
      fontWeight: '600',
      fontStyle: 'normal',
      fontSize: '14px',
      letterSpacing: '.1em',
      lineHeight: '1.em',
      textTransform: 'uppercase',
      color: '#001726',
    },
    body1: {
      fontFamily:'montserrat',
      fontWeight: '400',
      wordWrap: 'break-word',
      fontStyle: 'normal',
      fontSize: '.8em',
      letterSpacing: '.015em',
      lineHeight: '1.7em',
      textTransform: 'none',
      color: '#001726',
      paddingBottom: '1em',
    },
    button: {
      fontFamily:'montserrat',
      fontWeight: '600',
      letterSpacing: '.1em',
      fontSize: '12px',
      textTransform: 'lowercase',
      color:'#001726'
    },
    caption: {
      fontFamily: 'oswald',
      fontWeight: '700',
      fontStyle: 'normal',
      fontSize: '12px',
      letterSpacing: '.1em',
      lineHeight: '3em',
      textTransform: 'uppercase',
      color: '#000',
    }
  },
});

// const useStyles = makeStyles((theme) => ({
//   root: {
//     margin: 'auto',
//   },
//   topNavigation: {
//     backgroundColor: 'white'
//   }
// }))

function Frontpage(props) {
  const { classes } = this.props;
  //const classes = useStyles();

  return (
      <div className={classes.root}>
        <Grid style={{backgroundColor: '#f9f6f4'}} container>
          <Hidden smDown>
              <HorizontalMenu />
          </Hidden>
          <Hidden mdUp>
              <BurgerMenu />
          </Hidden>
          <Grid style={{padding: '0px' }} item xs={12}>
            <Banner bannerImg={topBannerImg} bannerText="Technical & product services with a human touch."  />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
          <Grid style={{marginBottom: '40px' }} item xs={10} sm={8}>
            <AboutUs />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
          <Grid style={{padding: '0px' }} item xs={12}>
            <Banner bannerImg={middleBannerImg} />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
          <Grid item xs={10} sm={8}>
            <Services />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
          <Grid style={{padding: '0px' }} item xs={12}>
            <Banner bannerImg={bottomBannerImg} />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
          <Grid item xs={10} sm={8}>
            <ContactUs />
          </Grid>
          <Grid item xs={1} sm={2}>
          </Grid>
        </Grid>
      </div>
  );
}

Frontpage.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Frontpage);
